<div style={{ height: 500 }}>
  <h1>{this.props.title}</h1>
  </div> :
  <div></div>
)


  export class ImageParallax extends React.Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
        <Parallax bgImage={this.props.url} strength={500}>
          {title}
          </Parallax> );
    }
};

